import React from 'react';
import AddressComponents from './AddressComponents';


const App = () => {
  let address = {
    name   : 'Express Scripts'

  };

  return (
    <section>
      <AddressComponents address={address}/>
      <h1>Hello, world!</h1>

    </section>
  );
};

export default App;
